import React, { Fragment } from "react";
import Artists from "./Artists";

const TrackItem = (props) => {
  return (
    <div className="pt-4 pl-20 pr-20">
      <div className="flex pt-1 pb-1 pl-1 items-center border-2 border-sky-500 rounded-lg hover:shadow-xl transition duration-500">
        <h1>{props.rank}</h1>
        <div className="pl-3 flex items-center">
          <a href={props.link} target="_blank" rel="noreferrer">
            <img className="rounded-lg" src={props.picture[2].url} alt="" />
          </a>
          <div className="">
            <a
              href={props.link}
              target="_blank"
              rel="noreferrer"
              className="hover:text-cyan-400 hover:underline transition duration-500"
            >
              <span className="font-bold">{props.title}</span>
            </a>
            <Artists artists={props.artists} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default TrackItem;
